  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line Files are shapefiles and
  related database files (.dbf) that are an extract of selected geographic and cartographicn
  \                                 information from the U.S. Census Bureau's Master
  Address File / Topologically Integrated Geographic Encoding and Referencingn                                  (MAF/TIGER)
  Database (MTDB).  The MTDB represents a seamless national file with no overlaps
  or gaps between parts, however, eachn                                  TIGER/Line
  File is designed to stand alone as an independent data set, or they can be combined
  to cover the entire nation.  Trafficn                                  analysis
  districts (TADs) are basic aggregates of traffic analysis zones (TAZs) created to
  provide a higher level geographic entity ton                                  facilitate
  the ability of transportation planners to forecast changes in commuting patterns,
  trip volumes, and modes of travel, and ton                                  develop
  plans to meet the changing demands for transportation facilities and capacities.\",\n\t\"license_title\":
